import React from 'react';

import './index.css';

function Cards(props) {
    console.log(props)
    return (

        <div>
            <div className="cardblock">
                <a href={props.links}> <img src={props.imgsrc} alt="Netflix Properties" className="zoom" /></a>
                <h3 style={{ textAlign: 'center' }} className="zoom">{props.sname}</h3>
            </div>
        </div>
    );
}

export default Cards;


function topbar() {

    return (
        
        <React.Fragment> 
            <div>
                <div>
                    <h2></h2>
                    </div>
                </div>
        </React.Fragment>
        );
}


function sidebar() {

    return (
        <>
            <h3>About Website</h3>
            <p style={{ color: 'white', backgroundColor: 'grey' }}>Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>
        </>


    );
}

export { Cards, topbar ,sidebar};
